import React, { useRef } from 'react';
import classes from './App.module.css';
// import Header from './components/Header';
import Intro from './components/Intro';
import TaskBar from './components/TaskBar';
import AboutMe from './components/AboutMe';
import Experience from './components/Experience';
import ContactMe from './components/ContactMe';
import Projects from './components/Projects';
import RoundCharacter from './Assets/Image4 1.png';
import { Parallax, ParallaxLayer } from '@react-spring/parallax';

const App = () => {

  const ref = useRef();

  return (
    <div>
      <div style={{ width: '100%', height: '100%', background: 'red' }}>
        <Parallax pages={4} ref={ref} >
          <ParallaxLayer offset={0} speed={0.02}>
            <div className={classes.Intro}><Intro/></div>
          </ParallaxLayer>

          <ParallaxLayer offset={1} speed={0.2}>
            <div className={classes.aboutMeContainer}><AboutMe/></div>
          </ParallaxLayer>

          <ParallaxLayer offset={1.9} speed={0.2}>
            <div className={classes.aboutMeContainer}><Experience/></div>
          </ParallaxLayer>

          <ParallaxLayer offset={2.7} speed={0.2}>
            <div className={classes.aboutMeContainer}><Projects/></div>
          </ParallaxLayer>

          <ParallaxLayer offset={3.6} speed={0.2}>
            <div className={classes.aboutMeContainer}><ContactMe/></div>
          </ParallaxLayer>

          <ParallaxLayer
            sticky={{ start: 1.55, end: 1.6 }}
            style={{ textAlign: 'center' }}
          >
            <div className={classes.imageContainer}>
              <img src={RoundCharacter} alt="Character whistling" className={classes.imageSize}/>
            </div>
          </ParallaxLayer>
        </Parallax>

        <div>
          <TaskBar className={classes.taskBarContainer}/>
        </div>

        {/* <div className={classes.Intro}>
          <Intro />
        </div>

        <div className={classes.aboutMeContainer}>
          <AboutMe/>
        </div>

        <div className={classes.ExpericeContainer}>
          <Experience/>
        </div>

        <div>
          <Projects/>
        </div>

        <div className={classes.ExpericeContainer}>
          <ContactMe/> */}
        {/* </div> */}
      </div>
    </div>
  );
};

export default App;
